import {
  Box,
  ClickAwayListener,
  Divider,
  Grow,
  MenuItem,
  MenuList,
  Paper,
  Popper,
  Typography,
} from "@mui/material";
import router from "next/router";
import React from "react";
import { Dataimage } from "./data";

const AppBarDesktopRoutesPopper = (props) => {
  const { isOpen, anchorEl, handleClosePopover } = props;

  return (
    <Popper
      open={isOpen}
      placement="auto"
      transition
      anchorEl={anchorEl}
      style={{ zIndex: 1100 }}
    >
      <Grow
        {...TransitionProps}
        style={{
          transformOrigin: placement === "auto" ? "left top" : "left bottom",
        }}
      >
        {" "}
        <Paper>
          <ClickAwayListener onClickAway={() => handleClosePopover()}>
            <MenuList>
              {Dataimage.map((item, index) => (
                <MenuItem
                  key={item.item}
                  value={item.item}
                  onClick={() => {
                    router.push(item.router);
                    handleClosePopover();
                  }}
                >
                  <Box
                    display="flex"
                    width="100%"
                    height="100%"
                    flexDirection="column"
                    justifyContent="space-between"
                  >
                    <Box display="flex" alignItems="center" height="100%">
                      <Typography paddingLeft="8px">{item.title}</Typography>
                    </Box>
                    {index != Dataimage.length - 1 && <Divider />}
                  </Box>
                </MenuItem>
              ))}
            </MenuList>
          </ClickAwayListener>
        </Paper>
      </Grow>
    </Popper>
  );
};
export default AppBarDesktopRoutesPopper;
